import React from "react";
import { Switch, Route } from "react-router";

const App = () => {
  return (
    <Switch>
      <Route exact path="/">
        This is home page
      </Route>
      <Route path="/about">This is about page</Route>
      <Route>not found</Route>
    </Switch>
  );
};

export default App;
